import React from "react";
import "./App.css";
import Content from "./component/content/Content";
import Footer from "./component/Footer";
import Header from "./component/Header";

const ThemeContext = React.createContext();

function App() {
  return (
    <ThemeContext.Provider>
      <div className="App">
        <Header />
        <Content />
        <Footer />
      </div>
    </ThemeContext.Provider>
  );
}

export default App;
